-light\"}] [:div [:p/code \"(defn abcd [x] (+ x 9))\"]]], \"386\" [:div nil [:div [:p/markdown \"## Unit tests\\n\\nComing soon.\"]]], \"246\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"222\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"250\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"289\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"267\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"307\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Notespace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"283\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"208\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"312\" [:div [:p/code {:code \"(deref d2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"12\\n\"}]]], \"276\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"337\" [:div [:p/code {:code \"^kind/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"347\" [:div [:p/code {:code \"^kind/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]]], \"218\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"335\" [:div nil [:div [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]]], \"331\" [:div [:p/code {:code \"a\", :bg-class \"bg-light\"}] [:div [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"{:x 3}\\n\"}]]]], \"352\" [:div nil [:div [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]]], \"376\" [:div nil [:div [:p/markdown \"Notes which are forms like `(def ...)` or `(defn ...)` are assigned the kind `:void`.\"]]], \"360\" [:div nil [:div [:p/markdown \"### Vega-lite is supported\"]]], \"399\" [:div nil [:div [:p/markdown \"We can ask for a tests summary:\"]]], \"241\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"293\" [:div [:p/code {:code \"(def ^{:doc \\\"When making a user extensible kind, you MUST assign the keyword\\nto a variable. Annotating with a keyword WILL NOT WORK!\\\"} just-code ::just-code)\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"257\" [:div [:p/code {:code \"^kind/hiccup\\n(into nospace\"}} [:small \"(not evaluated yet)\"]]]], \"272\" [:div [:p/code {:code \"^kind/dataset-grid\\n[{:a 1 :b 4}\\n {:a 2 :b 5}\\n {:a 3 :b 6}]\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"320\" [:div nil [:div [:p/markdown \"### Listening to changes\\n\\n`(notespace.api/listen)` will tell Notespace to listen to changes in the file corresponding to the current namespace (on a file save). When changes occur, (notespace.api/eval-and-realize-notes-from-change) is called. This results in an [Oz](https://github.com/metasoarous/oz)-like live-reload experience.\\n\\n`(notespace.api/unlisten)` will tell Notespace to stop listening to the current namespace.\"]]], \"325\" [:div nil [:div [:p/markdown \"### Futures\"]]], \"205\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"306\" [:div nil [:div [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]]], \"287\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"229\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"316\" [:div nil [:div [:p/markdown \"#### eval-and-realize-this-notespace\\n\\nUse `notespace.api/eval-and-realize-this-notespace` to evaluate all notes in the current namespace sequentially, one note after another, and then realize them in the background. As always, Notespace is informed about the results.\"]]], \"235\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"206\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"216\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"217\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"344\" [:div nil [:div nil]], \"398\" [:div [:p/code {:code \"(fact\\n (+ 1 2) => 4)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big {:style {:color \"darkred\"}} \"❌\"]] \"   false\"]]], \"324\" [:div nil [:div [:p/markdown \"If you have called `notespace.api/eval-and-realize-note-at-line` with the line holding this note, or `notespace.api/eval-and-realize-this-notespace` with this notespace, then you should see the number 3 there. Otherwise, you should see a mark that says it is still pending.\"]]], \"260\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"390\" [:div nil [:div [:p/markdown \"## Extending Notespace with new note kinds.\"]]], \"377\" [:div nil [:div [:p/markdown \"All other notes witn no explicit metadata are assigned the kind `:naive` automatically.\"]]], \"353\" [:div nil [:div [:big [:big 3]]]], \"301\" [:div [:p/code {:code \"^kind/hiccup\\n(notespace/midje-summary)\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not evaluated yet)\"]]]], \"317\" [:div nil [:div [:p/markdown \
